import React, { Component } from "react";


class  About extends Component {
  state = {}
  handleShow = () => this.setState({ active: true })
  handleHide = () => this.setState({ active: false })

  render() {
    return(
      <div className="about"> ABOUT CONTAINER</div>
    )
  }
}

export default About;
